        <Chat />
        {/* <Switch>
        <Route path='/' component={Landing} />
        <Route path='/signup' component={SignUpPage} />
        </Switch> */}
        </React.Suspense>
      </div> 
    </BrowserRouter>
    </>
  );
}

export default App;
